import Image from '../assets/Home.jpg';

const Home = () => {
    return(
        <div>
            <img src={Image} className="block w-full h-full " />
            <h1 className="flex items-center justify-center p-24 text-center">Home</h1>
        </div>
        )
}

export default Home;
